function setBubble(x,y,sector){var xObj=srcIndicatorOpt[x];var yObj=srcIndicatorOpt[y];var data={type:'scatter',x:[],y:[],mode:'markers',meta:[],hovertemplate:'%{meta}<br>'+xObj.label+': %{x}'+xObj.unit+'<br>'+yObj.label+': %{y}'+yObj.unit+'<extra></extra>',hoverlabel:{font:{family:fontFamily,color:'#fffff'}},marker:{size:[],color:[],line:{width:1.0,},opacity:0.7,},};Object.entries(srcTickers).forEach(([ticker,obj])=>{if((sector!='ALL')&&(sector!=obj.sectorCode)){return;}
data.x.push(obj[x]);data.y.push(obj[y]);data.meta.push(obj.meta);data.marker.size.push(obj.size);data.marker.color.push(srcSectors[obj.sectorCode].color);});bubbleLayout.xaxis.title=xObj.label+(xObj.unit?'['+xObj.unit+']':'');bubbleLayout.yaxis.title=yObj.label+(yObj.unit?'['+yObj.unit+']':'');bubbleLayout.shapes=[{type:'line',xref:'paper',x0:0,x1:1,y0:yObj.mean,y1:yObj.mean,line:{color:'grey',width:1,dash:'dot'}},{type:'line',yref:'paper',x0:xObj.mean,x1:xObj.mean,y0:0,y1:1,line:{color:'grey',width:1,dash:'dot'}}];Plotly.newPlot('plotly',[data],bubbleLayout,bubbleOption).then(function(){if(!TOOLBOX){$('.js-plotly-plot .plotly .modebar').css({'display':'none'});}});}
$(document).ready(function(){if(isTablet){$('.service-opt-r').css({'flex-wrap':'nowrap','flex-direction':'row',});}
setOption('.bubble-x',srcIndicatorOpt,'D-1');setOption('.bubble-y',srcIndicatorOpt,'Y-1');setOption('.bubble-sectors',srcSectors,"ALL");setSearchBar('.bubble-searchbar',srcTickers,$('.bubble-sectors').val());setBubble($('.bubble-x').val(),$('.bubble-y').val(),$('.bubble-sectors').val());setAxisLabel('.bubble-x','X');setAxisLabel('.bubble-y','Y');$('.toolbox-on').click(function(){toggleToolbox();})
$('.bubble-sectors').on('change',function(){setSearchBar('.bubble-searchbar',srcTickers,$(this).val());setBubble($('.bubble-x').val(),$('.bubble-y').val(),$(this).val());})
$('.bubble-x').on('change',function(){setAxisLabel('.bubble-x','X');setBubble($(this).val(),$('.bubble-y').val(),$('.bubble-sectors').val());})
$('.bubble-y').on('change',function(){setAxisLabel('.bubble-y','Y');setBubble($('.bubble-x').val(),$(this).val(),$('.bubble-sectors').val());})
$('.bubble-searchbar').on('select2:select',function(e){var obj=srcTickers[e.params.data.id];Plotly.relayout('plotly',{'xaxis.range':[0.9*obj[$('.bubble-x').val()],1.1*obj[$('.bubble-x').val()]],'yaxis.range':[0.9*obj[$('.bubble-y').val()],1.1*obj[$('.bubble-y').val()]]})});})